INSERT INTO `wp_comments` VALUES (1,1,'Sr. WordPress','','https://wordpress.org/','','2016-06-03 18:50:57','2016-06-03 21:50:57','Olá, Isto é um comentário.\nPara excluir um comentário, faça o login e veja os comentários de posts. Lá você terá a opção de editá-los ou excluí-los.',0,'1','','',0,0),(2,108,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:57:05','2013-06-07 11:57:05','Simple and effective design. One of my favorites.',0,'1','','',0,0),(3,109,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:53:49','2013-06-07 11:53:49','Wonderful quality, and an awesome design. WooThemes ftw!',0,'1','','',0,0),(4,109,'Andrew','andrew@chromeorange.co.uk','','86.19.152.140','2013-06-07 11:57:45','2013-06-07 11:57:45','This t-shirt is awesome! Would recommend to everyone!\n\nI\'m ordering mine next week',0,'1','','',0,0),(5,110,'James Koster','james@jameskoster.co.uk','','86.146.141.82','2013-06-07 11:43:13','2013-06-07 11:43:13','Nice T-shirt, I got one in black. Goes with anything!',0,'1','','',0,0),(6,110,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:55:15','2013-06-07 11:55:15','Very comfortable shirt, and I love the graphic!',0,'1','','',0,0),(7,110,'Stuart','stuart@woothemes.com','','82.32.109.140','2013-06-07 13:02:14','2013-06-07 13:02:14','Great T-shirt quality, Great Design and Great Service.',0,'1','','',0,0),(8,111,'Cobus Bester','bester.c@gmail.com','','196.215.9.147','2013-06-07 11:54:32','2013-06-07 11:54:32','The ninja silhouette is one of my favorite designs. This is a great product.',0,'1','','',0,0),(9,113,'Stuart','stuart@woothemes.com','','82.32.109.140','2013-06-07 13:01:25','2013-06-07 13:01:25','This will go great with my Hoodie that I ordered a few weeks ago.',0,'1','','',0,0),(10,113,'Maria','maria@woothemes.com','','24.225.103.32','2013-06-07 15:49:53','2013-06-07 15:49:53','Love this shirt! The ninja near and dear to my heart. &lt;3',0,'1','','',0,0),(11,114,'Stuart','stuart@woothe