INSERT INTO `wp_posts` VALUES (1,1,'2016-06-03 18:50:57','2016-06-03 21:50:57','Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!','Olá, mundo!','','publish','open','open','','ola-mundo','','','2016-06-03 18:50:57','2016-06-03 21:50:57','',0,'http://127.0.0.1/Workspace/side/minhaloja/?p=1',0,'post','',1),(2,1,'2016-06-03 18:50:57','2016-06-03 21:50:57','Esta é uma página de exemplo. É diferente de um post porque ela ficará em um local e será exibida na navegação do seu site (na maioria dos temas). A maioria das pessoas começa com uma página de introdução aos potenciais visitantes do site. Ela pode ser assim:\n\n<blockquote>Olá! Eu sou um bike courrier de dia, ator amador à noite e este é meu blog. Eu moro em São Paulo, tenho um cachorro chamado Tonico e eu gosto de caipirinhas. (E de ser pego pela chuva.)</blockquote>\n\nou assim:\n\n<blockquote>A XYZ foi fundada em 1971 e desde então vem proporcionando produtos de qualidade a seus clientes. Localizada em Valinhos, XYZ emprega mais de 2.000 pessoas e faz várias contribuições para a comunidade local.</blockquote>\nComo um novo usuário do WordPress, você deve ir até o <a href=\"http://127.0.0.1/Workspace/side/minhaloja/wp-admin/\">seu painel</a> para excluir essa página e criar novas páginas com seu próprio conteúdo. Divirta-se!','Página de Exemplo','','publish','closed','open','','pagina-exemplo','','','2016-06-03 18:50:57','2016-06-03 21:50:57','',0,'http://127.0.0.1/Workspace/side/minhaloja/?page_id=2',0,'page','',0),(134,1,'2016-06-12 23:10:10','2016-06-13 02:10:10','','Variação 134 de Happy Ninja','','publish','closed','closed','','product-117-variation-2','','','2016-06-12 23:11:33','2016-06-13 02:11:33','',117,'http://127.0.0.1/Workspace/side/minhaloja/\'/product_variation/product-117-variation-2',0,'product_variation','',0),(4,1,'2016-06-03 19:12:39','2016-06-03 22:12:39','','model-1335984_1280','','inherit','open','closed','','model-1335984_1280','','','2016-0